geregisseerd door Mischa Kamp
met Faas Wijn, Rifka Lodeizen en Jeroen Spitzenberger

Tony is bijna tien en heeft de beste vader van de wereld. Hij is apetrots op zijn vader die opklimt van kraanmachinist tot minister. Maar op een dag hebben zijn ouders een heftige ruzie en loopt zijn vader weg van huis. Tony denkt dat zijn vader verliefd is geworden op de koningin. Hij doet er alles aan om zijn ouders weer bij elkaar te krijgen en krijgt daarbij hulp van het koninklijk huis.



